import React, { useState, useEffect } from 'react';
import { Table } from 'react-bootstrap'
import ReactPaginate from "react-paginate";
import axios from 'axios';
import * as XLSX from 'xlsx';
import { FiArrowUp, FiArrowDown } from 'react-icons/fi'

const AgingMoreThan30 = () => {

    const [post, setPost] = useState([]);
    const [number, setNumber] = useState(1);
    const [postPerPage] = useState(100);
    const [searchQuery, setSearchQuery] = useState('');
    const lastPost = number * postPerPage;
    const firstPost = lastPost - postPerPage;

    const exportToExcel = () => {
        const fileType =
            'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;charset=UTF-8';
        const fileExtension = '.xlsx';
        const fileName = 'online_sites';

        const ws = XLSX.utils.json_to_sheet(filteredPosts);
        const wb = { Sheets: { data: ws }, SheetNames: ['data'] };
        const excelBuffer = XLSX.write(wb, {
            bookType: 'xlsx',
            type: 'array',
        });
        const data = new Blob([excelBuffer], { type: fileType });
        const href = URL.createObjectURL(data);
        const link = document.createElement('a');
        link.href = href;
        link.download = fileName + fileExtension;
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    };


    const filteredPosts = post
        ? post.filter(post =>
            post.atmid && post.atmid.toLowerCase().includes(searchQuery.toLowerCase())
        )
        : [];

    const handleSearch = e => {
        setSearchQuery(e.target.value);
    };


    const currentPost = filteredPosts.slice(firstPost, lastPost);
    const PageCount = Math.ceil(filteredPosts.length / postPerPage);
    const ChangePage = ({ selected }) => {
        setNumber(selected + 1);
    };

    useEffect(() => {
        axios.get('http://localhost:8000/30DaysAgingDetails')
            .then(response => {
                if (response.data && response.data.length > 0) {
                    setPost(response.data);
                }
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    return (
        <div
        >
             <div className="row">
                <div className="col-6 pt-3">
                    <h6>Aging sites more than  <span style={{ color: 'red', fontWeight: 'bold', fontSize: '15px' }}>( 30 days )</span></h6>

                </div>
                <div className="col-6 d-flex justify-content-end">
                    <div className='col-4 text-end login-form2'>
                        <button onClick={exportToExcel} className="btn btn-primary mt-3">
                            Export to Excel
                        </button>
                    </div>
                </div>
            </div>
            <Table striped bordered hover className='custom-table mt-4'>
                <thead>
                    <tr>
                        <th>Sr No</th>
                        <th>ATM ID</th>
                        <th>Up/Down</th>
                        <th>Device Time</th>
                        <th>HDD Status</th>
                        <th>City</th>
                        <th>State</th>
                        <th>Zone</th>
                        <th>No of Days</th>
                        <th>Time Difference</th>
                    </tr>
                </thead>
                <tbody>
                    {post.length > 0 ? (
                        currentPost.map((users, index) => {
                            return (
                                <tr key={index}>
                                    <td>{index + 1}</td>
                                    <td style={{ color: 'darkblue', fontWeight: 'bold', fontSize: '15px' }}>{users.atmid}</td>
                                    <td>
                                        {users.login_status === 'working' ? (
                                            <FiArrowUp style={{ color: 'green', fontSize: '20px' }} />
                                        ) : (
                                            <FiArrowDown style={{ color: 'red', fontSize: '20px' }} />
                                        )}
                                    </td>
                                    <td>{users.cdate}</td>
                                    <td style={{ color: users.hdd_status === 'working' ? 'green' : 'red', fontWeight: 'bold', fontSize: '15px' }}>
                                        {users.hdd_status}
                                    </td>
                                    <td>{users.city}</td>
                                    <td>{users.state}</td>
                                    <td>{users.zone}</td>
                                    <td style={{ color: 'red', fontWeight: 'bold', fontSize: '15px' }}>{users.days_difference}</td>
                                    <td style={{ color: 'red', fontWeight: 'bold', fontSize: '15px' }}>{users.time_difference_hours_minutes}</td>
                                </tr>
                            );
                        })
                    ) : (
                        <tr>
                            <td colSpan='10'>Loading...</td>
                        </tr>
                    )}
                </tbody>
            </Table>
            <ReactPaginate
                previousLabel={"<"}
                nextLabel={">"}
                pageCount={PageCount}
                onPageChange={ChangePage}
                containerClassName={"paginationBttns"}
                activeClassName={"paginationActive"}
                disableInitialCallback={true}
                initialPage={0}
            ></ReactPaginate>
        </div>
    )
}

export default AgingMoreThan30
